  return (
    // BEM
    <div className="header">
      <PersonIcon />
      <img src="https://1000logos.net/wp-content/uploads/2018/07/tinder-logo.png" alt=""/>
      <h2> I am a header</h2>
      <ForumIcon />
    </div>
  );
}

export default Header;
